<script type="text/javascript">
  var loginAndLoad = function(){
  	var urlAuth = 'http://ws.ricardomartins.net.br/pspro/v6/getStoresToAuth?key=';
  	if(document.URL.search('local') > 0 || document.URL.search('127.0.0.1') > 0){
	    urlAuth = "http://ws.local.com.br/pspro/v6/getStoresToAuth?key=";
	}
	urlAuth += jQuery('input[name="key"]').val();

  	jQuery('a[name="btnLogin"]').hide();

	jQuery.ajax({
		url: urlAuth,
		method: 'GET',
		crossDomain: true,
		success: function(data) {

			if(data.errors > 0){
				jQuery('#msgRetorno').html(data.msg);
				jQuery('#msgRetorno').css('color','red');
			}else{
				jQuery('#msgRetorno').html('');
				if (data.stores.length > 0) {
					var addHtml = '';
					for(x=0; x < data.stores.length; x++) {
						current = data.stores[x];
						addHtml += "<li id='merchant-" + current.authorization_key +"'> E-mail do lojista: "+ current.merchant_email + "<br/>URL: " + current.url + "<br/>Solicitado em: "+ current.last_update;
						addHtml += "<br/><button onclick='acao(\""+ current.authorization_key + "\", \"allow\")'>Aprovar</button> <button onclick='acao(\""+ current.authorization_key + "\", \"deny\")'>Reprovar</button><br/><br/></li>";
					}
					jQuery('#lojas').html(addHtml);
				}else{
					jQuery('#msgRetorno').html('Nenhuma loja para autorizar. Obrigado.');
				}	
			}
		},
		dataType: 'json'
	});
	jQuery('a[name="btnLogin"]').show();
}

var acao = function(authCode, allowOrDeny)
{
	var urlAuth = 'http://ws.ricardomartins.net.br/pspro/v6/appAuth/';
  	if(document.URL.search('local') > 0 || document.URL.search('127.0.0.1') > 0){
	    urlAuth = "http://ws.local.com.br/pspro/v6/appAuth/";
	}
	urlAuth += allowOrDeny;

	jQuery.ajax({
		url: urlAuth,
		method: 'POST',
		data: {/*'key': jQuery('input[name="key"]').val(), */'authorization_key': authCode},
		crossDomain: true,
		success: function(data) {
			if(data.errors > 0){
				jQuery('#merchant-' + authCode).html(data.msg);
			}else{
				jQuery('#merchant-'+authCode).html(data.msg);
			}
		},
		dataType: 'json'
	});
}
</script>
